import React, { useState, useEffect } from "react";
import style from "../styles/Detail.module.css";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getDogId } from "../redux/actions/actions";

export default function Detail() {
  const { id } = useParams();
  const dispatch = useDispatch();
  const dog = useSelector((state) => state.currentDog);

  useEffect(() => {
    dispatch(getDogId(id));
  }, [dispatch, id]);

  return (
    <div className={style.detail} key={dog.id}>
      <img src={dog.image_url} alt={dog.name} />
      <div>
        <h1>{dog.name}</h1>
        <h2>{dog.temperament}</h2>
      </div>

      <div className={style.text_contain}>
        <h3>{dog.weight}</h3>
        <h3>{dog.height}</h3>
        <h3>{dog.life_span}</h3>
      </div>
    </div>
  );
}
